import Todo from './Todo'

export default function TodoList({ todos }) {
  return (
    <>
      <h2 id="todo_header">My To do's</h2>
      <section id="todo_grid">
        {todos && todos.length > 0 ? (
          todos.map((todo) => (
            <Todo
              key={todo.id}
              id={todo.id}
              title={todo.title}
              content={todo.content}
              removeTodo={removeTodo}
            />
          ))
        ) : (
          <p>Ingen todos</p>
        )}
      </section>
    </>
  )
}
